class Solution1:
    def maxProduct(self, nums):
        m=max(nums)
        def subArray(l):
            arr=nums[:l]
            max=1
            for n in arr:
                max*=n
            current=max
            for i in range(l,len(nums)):
                if(nums[i-l]!=0):
                    current=current*nums[i]/nums[i-l]
                else:
                    arr=nums[i-l+1:i+1]
                    current=1
                    for n in arr:
                        current*=n
                if(current>max):
                    max=current
            return max
        for i in range(2,len(nums)+1):
            m=max(m,subArray(i))
        return int(m)

class Solution2(object):
    def maxProduct(self, nums):
        n = len(nums)

        currMax = nums[0]
        currMin = nums[0]
        maxProd = nums[0]

        for i in range(1, n):
            temp = max(nums[i], nums[i] * currMax, nums[i] * currMin)
            currMin = min(nums[i], nums[i] * currMax, nums[i] * currMin)
            currMax = temp
            maxProd = max(maxProd, currMax)

        return maxProd
        

